import NavigationContainer from '@react-navigation/native/lib/typescript/src/NavigationContainer';
import React from 'react';
import { Image } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

const Tab = createBottomTabNavigator();

const HomeScreen = ({ navigation }) => {
    return (
        <NavigationContainer independent={true}>
            <Tab.Navigator
                //TODO: remover depois o initial
                initialRouteName='Home'
                screenOptions={({ route }) => ({
                    tabBarIcon: ({ focused, color, size }) => {
                        let iconName;
                        switch (route.name) {
                            case 'Home':
                                iconName = '';
                                break;
                            default:
                                iconName = '';
                                break;
                        }

                        return <Image style={{ width: 20, height: 20 }} source={iconName} />;
                    },
                })}
                tabBarOptions={{
                    activeTintColor: '#34c9b1',
                    inactiveTintColor: 'grey',
                }}>
                <Tab.Screen name="Home" component={() => <HomeScreen navigation={navigation} />} />
            </Tab.Navigator>
        </NavigationContainer>
    );
}

export default HomeScreen;
